import React from 'react';
import logo from './logo.svg';
import './App.css';
// Header Component 
import styled from 'styled-components';
import Header from './components/Header';

const Bounds = styled.div`
  height: 100%;
    margin: 0 60px;
    @media (max-width: 48em) { 
        margin: 0 12px;
    }
`
const HeroWrapper = styled.div`
  max-width: 580px;
  text-align: left;
`

const Headline = styled.h1`
  font-size: 50px;
  margin: 20px 0 0px 0;
  padding: 0;
  line-height: 1.1;
  font-weight: 500;
  @media screen and (min-width: 48em) {
    font-size: 68px;
    font-weight: 500;
    letter-spacing: -0.6px;
  }
`
const SubHeadline = styled.h1`
  font-size: 30px;
  line-height: 1.1;
  font-weight: 400;
  @media screen and (max-width: 48em) {
    font-size: 20px;
  }
`

function App() {
  return (
    <div className="App">
      <Header /> 
      <Bounds>
        <HeroWrapper>
          <Headline>Google Developer Group El Paso</Headline>
          <SubHeadline>We are a group of students and industry professionals who share a love for coding and developing & we strive to share that passion with others!</SubHeadline>
        </HeroWrapper>
      </Bounds>
    </div>
  );
}

export default App;
